import facebooklogo from "../images/facebook-icon.png";
import twitterlogo from "../images/twitter-icon.png";
import instagramlogo from "../images/instagram-icon.png";
import whatsapplogo from "../images/whatsapp-icon.png";
import linkedinlogo from "../images/linkedin-icon.png";
import snapchatlogo from "../images/snapchat-icon.png";

const NavSocial = () => {
  const date = new Date();
  return (
    <div id="top" className="nav-social">
      <ul className="to-left">
        <li className="date">
          <i className="calendar alternate outline icon"></i>{" "}
          {date.toDateString()}
        </li>
        <li className="phone-num">
          <i className="phone icon"></i> 080-080-0808
        </li>
      </ul>
      <ul className="to-right">
        <li>
          <a href="#">
            <img src={facebooklogo} alt="facebook" />
            <i className="facebook f icon"></i>
          </a>
        </li>
        <li>
          <a href="https://www.twitter.com/" rel="noreferrer" target="_blank">
            <i className="twitter icon"></i>
          </a>
        </li>
        <li>
          <a href="https://www.linkedin.com/" rel="noreferrer" target="_blank">
            <i className="linkedin icon"></i>
          </a>
        </li>
        <li>
          <a href="https://www.youtube.com/" rel="noreferrer" target="_blank">
            <i className="youtube icon"></i>
          </a>
        </li>
      </ul>
      <div className="clear"></div>
    </div>
  );
};

export default NavSocial;
